  return (
    <section>
      <h3 className="section__title"> New arrivals</h3>
      <div className="section__books">
        <div className="section__singleBook singleBook">
          <img src={bookImage} alt="the book" className="singleBook__image" />
          <h3 className="singleBook__title">Title of the book</h3>
          <p className="singleBook__description">
            Political pressure mounts to install a system of
            accountability when the actions of the Avengers lead to colla...
          </p>
          <small className="singleBook__price">$5</small>
          <DetailsButton />
        </div>
      </div>
    </section>
  );
};

export default homePage;
